window.bookSummaryJSON = "<p><b>Book Five in the bestselling, award-winning BEYOND series.</b> </p> <p><i>She's fought like hell to leave the past behind.</i> </p> <p>Trix changed her name and her life when she got clean four years ago. Now, she has a new family and a job she loves - tending bar and dancing at the Broken Circle. As an O'Kane, she's happy, untouchable. Until a nightmare from her old life tears her away from her home and drags her back to Hell - also known as Sector Five. </p> <p><i>He's still living - and dying - in it.</i> </p> <p>Losing Trix was the kick in the head Finn needed to get sober, but working as an enforcer for a man he hates is slowly crushing his soul. The only thing that keeps him going is his determination to destroy Sector Five from the inside. Then Trix comes back into his life - alive, in danger - and nothing else matters. </p> <p>Getting her home could be a suicide mission. The only thing deadlier is the old spark that flares to life between them. Soon, Finn and Trix are battling the one addiction neither of them ever managed to kick - each other. And it could cost them everything. </p>"; 
